function getUrl(t){var e=location.search;var n=e.substr(1);var r=n.split("=");if(r[0]==t){return r[1]}else{return"paramName error"}}var time=new function(){var t=new Date;this.getSimpleDate=function(){return t};this.getWeekdat=function(){return t.getDay()};this.getYear=function(){return t.getFullYear()};this.getMonth=function(){return t.getMonth()+1};this.getDay=function(){return t.getDate()};this.getHour=function(){return t.getHours()};this.getMin=function(){return t.getMinutes()};this.getSec=function(){return t.getSeconds()}};